const index = () => {
  return (
    <div className=' flex flex-col justify-center items-center'>
      <div
        className=' w-full h-auto py-32 object-cover bg-fixed ... '
        style={{ backgroundImage: "url(../../shop.jpg)" }}
      >
       <div className=" max-w-lg flex flex-col">
       <p className='font-extrabold font-green-700 text-2xl'>local market</p>
        <p>Get your product and leave the transaction with us </p>
        <form>
          <input
            type='text'
            placeholder='search for your desire product'
            className='bg-white h-6 rounded'
          />
        </form>
       </div>
      </div>
      <div className=' max-w-6xl w-full my-10'>all product</div>
    </div>
  );
};

export default index;
